function genDataB( data )
{
    var S = '';
    var items = data.length;
    var D = new Int8Array(items * 2);

    for( var i = 0; i<items; i++)
    {
        var v = data[i]; // a 16-bit constant
        v = v * 10;
        v = v + 1000;
        D[2*i + 0] = (v>>0) & 0x0ff; //LSB
        D[2*i + 1] = (v>>8) & 0x0ff; //MSB
    }

    D = new Buffer( D ).toString('base64');
    //console.log('D = ', D);
    S += D;
    //S += '</start>';

    return(S);
}


